webpackJsonp([7433184210657],{7600:function(e,t){e.exports={data:{post:{html:'<p>More political wisdom from <a href="http://dilbertblog.typepad.com/the_dilbert_blog/2006/05/income_gap.html" title="The Dilbert Blog: Income Gap">Scott Adams</a>:</p>\n<blockquote><p>Personally, I don\'t vote. That\'s partly because I know there isn\'t enough information available for me to make an informed decision, and partly because the rich white guys in power (my peeps) are doing a good job of taking from the poor and giving to me. I don\'t have much to gripe about.</p>\n</blockquote>\n<p>That\'s particularly timely given all the obituaries for <a href="http://news.google.com/news?hl=en&ned=us&q=John+Kenneth+Galbraith&btnG=Search+News" title="John Kenneth Galbraith - Google News">John Kenneth Galbraith</a> yesterday.</p>',fields:{title:"Political Wisdom",date:"02 May 2006",url:"https://papascott.de/2006-05-02-political-wisdom/"}}},pathContext:{slug:"/2006-05-02-political-wisdom/",prev:{fields:{title:"Kraut Eye for the Ami Guy",date:"30 Apr 2006",slug:"/2006-04-30-kraut-eye-for-the-ami-guy/"}},next:{fields:{title:"Bad Day Fishing",date:"03 May 2006",slug:"/2006-05-03-bad-day-fishing/"}}}}}});
